import React from 'react';

export default function About() {
    return (
        <div className="pages container-fluid">
            <h2> About Info</h2>
            <p> I am a passionate Full Stack Web Developer with a vast array of knowledge in many different front end and back end languages, responsive frameworks, databases, and best code practices. I am dedicated and eager to continue to learn, improve and update my skill set and problem solving techniques. I look forward to continuously gaining knowledge from my peers and work collaboratively with others while being able to contribute to the technology industry.</p>
            <div>
                <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="8390eb15-79a6-4436-abca-68dfcacf5931" data-share-badge-host="https://www.credly.com"></div><script type="text/javascript" async src="//cdn.credly.com/assets/utilities/embed.js"></script>
            </div>
        </div>
    );
}
